style.css:
@-moz-document domain(elethor.com) {
body{
color:#d4bddc;
}

#bottomNavPopout {
max-width:100% !important;
height:350px;
overflow-y:hidden;
background-color: rgba(0, 0, 0, 0.85);
}

.chat-messages {
height:290px;
overflow:auto;
margin-left:5px;
font-size:14px;
}

.chat-message-box {
width:80% !important;
}

.chat-box {
margin-left:5px;
position:relative !important;
height:2em;
}

.columns.is-mobile>.column.is-3 {
width:20%;
}
.menu {
font-size:16px !important;
}

button, progress, input, a{
border-radius: 20px 20px 20px 20px !important;
}
.container.level {
height:40px !important;
}
.level-item.has-text.is-marginless.is-size-7 {
font-size: 18px !important;
}

.progress svg { 
height:0.7em !important;
}

.columns.is-multiline.is-mobile {
    border-radius: 20px 20px 20px 20px !important;
}

#app::after {
    content:"";
    background: url("https://i.imgur.com/cPPkIbP.jpg");
    filter:brightness(15%);
    top:0;
    left:0;
    right:0;
    bottom:0;
    position:absolute;
    z-index:-1;
}

#game {
    background: #040404b3;
}

.is-fullwidth {
    text-shadow:-1px -1px 0 #8824a5, 1px -1px 0 #8824a5, -1px 1px 0 #8824a5, 1px 1px 0 #8824a5;
}
.button.is-fullwidth {
    background-color:#1c002d;
}
.button.is-info {
    background-color:#4a1771;
}
.table.is-fullwidth {
        background-color:#1d002f;
    }

.chat-channels.menu-list {
background-color:#29003e;
}

.is-active {
 background-color:  #8558a7 !important; 
}

#currentAction {
    background-color:#280146;
}
.navbar.is-fixed-top {
    background-color:#411e6f;
}
.has-background-success {
    background-color:#4a1771 !important;
}

#bottomNavSelector li {
background-color:#1c002d;    
}
#bottomNavSelector li.is-active a {
    background-color:#4a1771;
}
.user-name {
    color:#b571c6;
}

.column.is-3-desktop.is-6-touch.is-item {
width:10% !important;
}

.column.is-2-desktop.is-4-touch.is-item {
width: 10% !important;
}

.button.level.is-mobile {
    background-color: #625993;
}
.chat-box {
    background-color:rgb(65, 18, 88, 32%) !important;
    color: #d4bddc !important;
}
  ::-webkit-scrollbar
  {
    width: 10px;
  }

  ::-webkit-scrollbar-track
  {
    box-shadow: inset 0 0 5px grey;
    border-radius: 10px;
  }

  ::-webkit-scrollbar-thumb
  {
    background: #c06ad9;
    border-radius: 10px;
  }

  ::-webkit-scrollbar-thumb:hover
  {
    background: #a834cb;
  }

  ::-webkit-scrollbar-corner
  {
    background: rgba(0,0,0,0.5);
  }
}
